import React from 'react';

const About = () => {
    return (
        <div className="border border-2 shadow-lg p-3 mb-5 bg-body rounded w-50 mx-auto my-4">
            <h2 className="mb-3 border-bottom border-2 border-secondary text-secondary">We are your well wishers</h2>
            <p>Here we gather all the best courses around the Globe for learning web devlopement.</p>
            <p>So we are trying to  reduce your hassle a little bit by bringing all necessary courses under one website.Then you can choose your desire course and buy from that website.</p>
            <p>This website is not complete yet , we will add more feartures shortly</p>
        </div>
    );
};

export default About;
